import React from "react";
import { Card } from "../../Card.styled";
import { CardInline } from "../../Card.styled2";
const NavBar = ({ content }) => {
  return (
    <>
      <Card bd={"1px solid black"} height={"2rem"} mg={"2rem"}>
        <CardInline
          bd={"1px solid red"}
          width={"50%"}
          height={"90%"}
          mg={"none"}
          //   dp={"grid"}
          //   gridC={"auto auto auto auto"}
        >
          <Card>{content.NavBarContents[0]}</Card>
          <Card></Card>
          <Card></Card>
          <Card></Card>
        </CardInline>
        <CardInline
          float={"right"}
          bd={"1px solid red"}
          width={"40%"}
          height={"90%"}
        ></CardInline>
      </Card>
    </>
  );
};

export default NavBar;
